import React from 'react';
import './HomePage.css'; // Vamos criar esse arquivo de estilo em seguida

const HomePage = () => {
  return (
    <div className="home-container">
      <div className="icon-container">
        {}
        /<img src={require('../assets/images/avaliador-inteligente-logo.svg')} alt="Logo" className="logo" />
      </div>
      <div className="text-container">
        <h1>AVALIADOR INTELIGENTE</h1>
        <p>Uma plataforma educacional inovadora que utiliza inteligência artificial para fornecer feedback automatizado em questões de múltipla escolha.</p>
      </div>
    </div>
  );
};

export default HomePage;
